import React from "react";
import { Link } from "react-router-dom";
import logoImg from "./logo.svg"
import { Navbar } from "react-bootstrap"
import 'bootstrap/dist/css/bootstrap.min.css';
//import "./Page/LoginPage/style.scss"

export class Nav extends React.Component {
    render() {
        return (
            <Navbar bg="dark" variant="dark" expand="lg" sticky="top">
                <Navbar.Brand href="#home">
                    <img
                    alt=""
                    src={logoImg}
                    width="30"
                    height="30"
                    className="d-inline-block align-top"
                    />{' '}
                    NUS ModTree
                </Navbar.Brand>

                <ul className="nav-links">
                    <Nav.Link to="/select-modules">
                         <li class="nav-item">Select Modules</li>
                    </Nav.Link>
                     <Nav.Link to="/module-planner">
                         <li class="nav-item">Module Planner</li>
                     </Nav.Link>
                     <Link to="/cap-calculator">
                         <li class="nav-item">CAP Calculator</li>
                     </Link>
                 </ul>
                 <Navbar.Toggle aria-controls="basic-navbar-nav" />
            </Navbar>
//             <nav className="navbar navbar-expand-sm bg-dark navbar-dark">

//                 <ul className="nav-links">
//                     <Link to="/select-modules">
//                         <li class="nav-item">Select Modules</li>
